import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// Home page
import Home from "./pages/Homepage/Home";

// Admin page
import AdminHome from "./pages/Admin/AdminHome";
import Summary from "./pages/Admin/Summary";
import Login from "./pages/Admin/Login";
import TokenAssignment from "./pages/Admin/TokenAssignment";
import { Navigate } from "react-router-dom";
import { Vote } from "./pages/Vote";
import Layout from "./pages/Admin/components/Layout";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/' element={<Home />} />
        <Route path='/vote' element={<Vote />} />
        <Route path='/admin'>
            <Route index element={<Layout><AdminHome /></Layout>} />
            <Route path='summary' element={<Layout><Summary /></Layout>} />
            <Route path='login' element={<Login />} />
            <Route path='assign' element={<Layout><TokenAssignment /></Layout>} />
        </Route>
        <Route path='*' element={<Navigate to='/' />} />
      </Routes>
    </Router>
  );
}

export default App;
